void draw_bullet(int x, int y)
{
    write_pixel(x, y, ORANGE);
    if (y - 1 >= 0)
        write_pixel(x, y - 1, ORANGE);
    if (y - 2 >= 0)
    {
        write_pixel(x - 1, y - 2, ORANGE);
        write_pixel(x + 1, y - 2, ORANGE);
        write_pixel(x, y - 2, YELLOW);
    }
    if (y - 3 >= 0)
    {
        write_pixel(x - 1, y - 3, ORANGE);
        write_pixel(x + 1, y - 3, ORANGE);
        write_pixel(x, y - 3, YELLOW);
    }
    if (y - 4 >= 0)
        write_pixel(x, y - 4, ORANGE);
}
void draw_explosion(int x, int y)
{
    for (int j = y - 21; j < y + 21 && j >= 0 && j < 240; j++)
    {
        for (int i = x - 23; i < x + 22 && i >= 0 && i < 320; i++)
            if (explosion[j + 21 - y][i + 23 - x][1])
                write_pixel(i, j, explosion[j + 21 - y][i + 23 - x][0]);
    }
}
