// asteroid struct array
typedef struct
{
    int type;
    float x; // float coordinates and speed so as asteroids have to be lil bit slower than rest sprites
    float y;
    float speed;
    int health;
} Asteroid;

Asteroid *create_asteroid(int type, float x, float y, float speed, int health)
{
    Asteroid *asteroid = malloc(sizeof(Asteroid));
    if (asteroid == NULL)
    {
        fprintf(stderr, "Memory allocation failed\n");
        exit(EXIT_FAILURE);
    }
    asteroid->type = type;
    asteroid->x = x;
    asteroid->y = y;
    asteroid->speed = speed;
    asteroid->health = health;
    return asteroid;
}

typedef struct
{
    Asteroid *data;
    size_t size;
    size_t capacity;
} AsteroidVector;

AsteroidVector *create_asteroid_vector()
{
    AsteroidVector *vector = malloc(sizeof(AsteroidVector));
    if (vector == NULL)
    {
        fprintf(stderr, "Memory allocation failed\n");
        exit(EXIT_FAILURE);
    }
    vector->data = malloc(sizeof(Asteroid) * INITIAL_CAPACITY);
    if (vector->data == NULL)
    {
        fprintf(stderr, "Memory allocation failed\n");
        free(vector);
        exit(EXIT_FAILURE);
    }
    vector->size = 0;
    vector->capacity = INITIAL_CAPACITY;
    return vector;
}

void append(AsteroidVector *vector, Asteroid asteroid)
{
    if (vector->size >= vector->capacity)
    {
        // Double the capacity
        vector->capacity *= 2;
        // Reallocate memory for the data array
        Asteroid *temp = realloc(vector->data, sizeof(Asteroid) * vector->capacity);
        if (temp == NULL)
        {
            fprintf(stderr, "Memory allocation failed\n");
            exit(EXIT_FAILURE);
        }
        vector->data = temp;
    }

    vector->data[vector->size++] = asteroid;
}

void delete_at(AsteroidVector *vector, size_t index)
{
    if (index >= vector->size)
    {
        fprintf(stderr, "Index out of bounds\n");
        exit(EXIT_FAILURE);
    }
    for (size_t i = index; i < vector->size - 1; i++)
    {
        vector->data[i] = vector->data[i + 1];
    }
    vector->size--;
}

void free_asteroid_vector(AsteroidVector *vector)
{
    free(vector->data); // Free the memory for the data array
    free(vector);
}
