// statevariables and adresses
volatile int *KEY_ptr = (volatile int *)0xFF200100; // keyboard address
int key_value;
int Left_button_state = 0;
int Right_button_state = 0;
int space_button_state = 0;
int key_pressed_state = 0;
int key_released_state = 0;

// current difficulty
int bullet_speed = 6;         // pixel travel per frame it should be >6
int current_difficulty = 4;   // number of asteroids at max spawned
int time_between_spawns = 20; // time in no of frames bewtween consecutive random asteroid spawns
int spawn_counter = 0;        // creating  counter for time between spawns of asteroids
int asteroid_speed_limit = 1; // rand asteroid speed between 0.002 and limit in float

// spaceship coordinates initially
int spaceship_x = 144;
int spaceship_y = 160;
int spaceship_speed = 5; // 5 pixel per frame

