int score = 0, Hiscore = 0;

// updating states of things
void Updater(AsteroidVector *asteroidVector, BulletVector *bullets)
{
    // spaceship
    if (spaceship_x > 0 && Left_button_state == 1)
        spaceship_x -= spaceship_speed;
    if (spaceship_x < 288 && Right_button_state == 1)
        spaceship_x += spaceship_speed;

    // asteroids
    for (size_t i = 0; i < asteroidVector->size; i++)
    {
        asteroidVector->data[i].y += asteroidVector->data[i].speed;
    }
    // bullets
    for (size_t i = 0; i < bullets->size; i++)
    {
        bullets->data[i].y -= bullet_speed; // bullets have a speed 6
    }
}

// controlling movement
void control_move()
{
    key_value = *KEY_ptr;
    if ((key_value & 0xff) == 224) // key is pressed
    {
        key_value = *KEY_ptr;
        key_value = (key_value & 0xff);

        if (key_value == 116)
            Right_button_state = 1;
        else if (key_value == 107)
            Left_button_state = 1;

        else if (key_value == 0xf0) // key is released
        {
            key_value = *KEY_ptr;
            printf("%d\n", key_value);
            key_value = (key_value & 0xff);
            if (key_value == 116)
                Right_button_state = 0;
            else if (key_value == 107)
                Left_button_state = 0;
        }
    }

    else if (key_value > 0xff && (key_value & 0xff) == 41) // space is pressed
    {
        space_button_state = 1;
    }
    else if ((key_value & 0xff) == 240)
    {
        key_value = *KEY_ptr;
        if ((key_value & 0xff) == 41)
            space_button_state = 0;
    }
}
