// creating random asteroid
float random_float(float min, float max)
{
    return min + ((float)rand() / RAND_MAX) * (max - min);
}
int random_int(int min, int max)
{
    return min + rand() % (max - min + 1);
}
int Random_asteroid(AsteroidVector *asteroidVector, int prev_x)
{
    if (asteroidVector->size < current_difficulty)
    {
        int type = random_int(1, 6);
        int x = random_int(26, 294);
        while (x > prev_x - 50 && x < prev_x + 50)
            x = random_int(26, 294);
        int y = 0;
        float speed = random_float(0.002, asteroid_speed_limit);
        int Health = type * 5;

        Asteroid *as = create_asteroid(type, (float)x, (float)y, speed, Health);
        append(asteroidVector, *as);
        return x;
    }
    return prev_x;
}

