        srand(spaceship_x * spaceship_y);                                   // seeding randomly with counter

        control_move(); // controllling moves

        manage_difficulty();

        if (spawn_counter++ >= time_between_spawns) // spawing asteroids
        {
            prev_x = Random_asteroid(asteroidVector, prev_x);
            spawn_counter = 0;
        }

        Bullets_generator(bullets); // generating bullets if space is pressed
        // speed of bullets is in updater function

        Updater(asteroidVector, bullets); // updating sprites

